import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <header className="top">
        <h1>Catch Of The Day</h1>
        <h3 className="tagline">
          <span>Fresh Daily</span>
        </h3>
      </header>
    );
  }
}

export default Header;
